# `U` is a predefined unit of measure that means 19.05mm, which is MX spacing
units:
  diode_x: 8.25
  diode_y: 0
  diode_rotate: 90
  mx_cutout: 14
  mx_keycap: 18
  mcu_margin: 30
  outline_fillet: 10
  outline_margin: U/2
  rotary_encoder_x: (U + mcu_margin) / 2
  rotary_encoder_y: -5
  jstph_x: U - 2
  jstph_y: (-U/2) - 2
  trrs_x: (U + (mcu_margin-12.5))
  trrs_y: (U/2)

  # editable
  tangent_angle: -15
  screw_size: 2.2
  screw_size_offset: 0
  tangent_distance: 2
  tab_circle_edge_thickness: 2
  foot_radius: 1
  # editable

  screw_size_radius: (screw_size + screw_size_offset) / 2
  tangent_distance_formula: screw_size_radius + tangent_distance
  tab_circle_formula: screw_size_radius + tab_circle_edge_thickness
  tab_circle_cutout_formula: screw_size_radius

points:
  key:
    tags: [1u]
    footprints:
      switch:
        type: mx
        nets:
          from: =colrow
          to: =column_net
        params:
          reverse: true
          keycaps: true
      diode:
        type: diode
        anchor:
          shift: [diode_x, diode_y]
          rotate: diode_rotate
        nets:
          from: =colrow
          to: =row_net
        params:
          via_in_pad: true
  zones:
    matrix:
      columns:
        outer:
          key:
            column_net: outer_col
          rows:
            bottom:
              skip: true
        pinky:
          key:
            column_net: pinky_col
        ring:
          key:
            stagger: 0.6U
            column_net: ring_col
        middle:
          key:
            stagger: 0.15U
            column_net: middle_col
        index:
          key:
            stagger: -0.25U
            column_net: index_col
        inner:
          key:
            stagger: -0.15U
            column_net: inner_col
        extra:
          rows:
            bottom:
              skip: true
          key:
            stagger: -0.5u
            column_net: extra_col
            footprints:
              diode:
                anchor:
                  shift: [-diode_x, diode_y]
      rows:
        bottom:
          row_net: bottom_row
          padding: U

        home:
          row_net: home_row
          padding: U
        top:
          row_net: top_row
          padding: U
        number:
          row_net: number_row
          padding: U

    thumb_cluster:
      anchor:
        ref: matrix_inner_bottom
        shift: [-2U, -U]
      rows:
        mods:
          row_net: mods_row
      columns:
        mod_one:
          key:
            column_net: ring_col
        mod_two:
          key:
            column_net: middle_col
        near:
          key:
            spread: U + 2
            stagger: -1
            splay: -10
            column_net: index_col
        home:
          key:
            rotate: 90
            width: 1.25U
            shift: [0, 0.125mx_keycap]
            tags: [125u]
            column_net: inner_col
        far:
          key:
            rotate: -90
            width: 1.25U
            shift: [0, 0.125mx_keycap]
            tags: [125u]
            column_net: extra_col
            footprints:
              diode:
                anchor:
                  shift: [-diode_x, diode_y]
outlines:
  _switches:
    - what: rectangle
      where: true
      size: mx_cutout
      bound: false
  _keycaps_1u:
    - what: rectangle
      size: mx_keycap
      where: /1u/
      bound: false
  _keycaps_125u:
    - what: rectangle
      size: [1.25mx_keycap, mx_keycap]
      where: /125u/
      bound: false
  _plate_tab:
    - operation: stack
      what: polygon
      points:
        - shift: [0, 0]
        - shift: [0, foot_radius]
        - shift: [foot_radius, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: 90
        - shift: [tab_circle_formula, 0]
          orient: -90
        - shift: [tab_circle_formula, 0]
          orient: -tangent_angle*2
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [foot_radius, 0]
          orient: 90
        - shift: [foot_radius, 0]
          orient: tangent_angle - 90
      adjust:
        - shift: [0, foot_radius]
        - shift: [-foot_radius, 0]
          orient: tangent_angle
        - shift: [-tangent_distance_formula, 0]
          orient: 90
        - shift: [-tab_circle_formula, 0]
          orient: -90
        - shift: [0, 0]
          orient: -tangent_angle
        - ref: matrix_pinky_bottom
          affect: y
    - operation: subtract
      what: circle
      radius: foot_radius
      where:
        shift: [0, foot_radius]
      adjust:
        - shift: [0, foot_radius]
        - shift: [tab_circle_formula, 0]
          orient: -tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [-foot_radius, 0]
          orient: -90
        - ref: matrix_pinky_bottom
          affect: y
    - operation: subtract
      what: circle
      radius: foot_radius
      where:
        shift: [0, foot_radius]
      adjust:
        - shift: [0, foot_radius]
        - shift: [-tab_circle_formula, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [-foot_radius, 0]
          orient: 90
        - ref: matrix_pinky_bottom
          affect: y
    - operation: add
      what: circle
      radius: tab_circle_formula
      adjust:
        - shift: [0, foot_radius]
        - shift: [-tab_circle_formula, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [-foot_radius, 0]
          orient: 90
        - ref: matrix_pinky_bottom
          affect: y
        - shift: [0, foot_radius]
          orient: -tangent_angle
        - shift: [foot_radius, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: 90
        - shift: [tab_circle_formula, 0]
          orient: -90
    - operation: subtract
      what: circle
      radius: tab_circle_cutout_formula
      adjust:
        - shift: [0, foot_radius]
        - shift: [-tab_circle_formula, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [-foot_radius, 0]
          orient: 90
        - ref: matrix_pinky_bottom
          affect: y
        - shift: [0, foot_radius]
          orient: -tangent_angle
        - shift: [foot_radius, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: 90
        - shift: [tab_circle_formula, 0]
          orient: -90
  _base_outline:
    - what: polygon
      points:
        - ref: matrix_pinky_bottom
          shift: [-outline_margin, -outline_margin]
        - ref: matrix_outer_home
          shift: [-outline_margin, -outline_margin]
        - ref: matrix_outer_number
          # 0.001 fixes the DRC in kicad with out affecting the outline
          shift: [-outline_margin, outline_margin-0.001]
        - ref: matrix_middle_number
          shift: [-outline_margin - U, outline_margin]
        - ref: matrix_middle_number
          shift: [outline_margin + 1.55U, outline_margin]
        - ref: matrix_extra_number
          shift: [0, outline_margin]
        - ref: matrix_extra_number
          shift: [outline_margin+mcu_margin, outline_margin]
        - ref: matrix_extra_home
          shift: [outline_margin+mcu_margin, 0]
        - ref: thumb_cluster_far_mods
          shift: [-1.25U/2, outline_margin]
        - ref: thumb_cluster_far_mods
          shift: [1.25U/2, outline_margin]
        - ref: thumb_cluster_home_mods
          shift: [-1.25U/2, outline_margin]
        - ref: thumb_cluster_near_mods
          shift: [0, -outline_margin]
        # - ref: thumb_cluster_near_mods
        #   shift: [-outline_margin, -outline_margin]
        - ref: thumb_cluster_mod_two_mods
          shift: [outline_margin, -outline_margin]
        - ref: thumb_cluster_mod_one_mods
          shift: [-outline_margin, -outline_margin]
        - ref: matrix_pinky_bottom
          shift: [outline_margin, -outline_margin]
  pcb_outline:
    - what: outline
      name: _base_outline
      fillet: 1
  preview:
    - what: outline
      name: pcb_outline
      operation: add
      expand: 7
    - what: outline
      name: _keycaps_1u
      operation: subtract
    - what: outline
      name: _keycaps_125u
      operation: subtract
    - what: outline
      name: pcb_outline
      operation: stack

    # oled cutout
    - what: rectangle
      size: [15, 22]
      operation: stack
      where: matrix_extra_number
      adjust:
        shift: [(U + mcu_margin) / 2, -8]

    # rotary encoder
    - what: circle
      radius: 9.5
      operation: stack
      where: matrix_extra_home
      adjust:
        shift: [rotary_encoder_x, rotary_encoder_y]


  plate:
    - what: outline
      name: pcb_outline
      operation: add
    - name: _plate_tab
      operation: add
      where: matrix_pinky_bottom
      adjust:
        shift: [0, -outline_margin]
        rotate: 180
    - name: _plate_tab
      operation: add
      where: matrix_outer_number
      adjust:
        shift: [-outline_margin, 0]
        rotate: 90
    - name: _plate_tab
      operation: add
      where: matrix_outer_home
      adjust:
        shift: [-outline_margin, 0]
        rotate: 90
    - name: _plate_tab
      operation: add
      where: matrix_pinky_bottom
      adjust:
        shift: [-outline_margin, 0]
        rotate: 90
    - name: _plate_tab
      operation: add
      where: thumb_cluster_mod_one_mods
      adjust:
        shift: [outline_margin, -outline_margin]
        rotate: 180
    - name: _plate_tab
      operation: add
      where: thumb_cluster_home_mods
      adjust:
        shift: [-1.25U/2, -U/2]
        rotate: 90
    - name: _plate_tab
      operation: add
      where: thumb_cluster_far_mods
      adjust:
        shift: [-0, outline_margin]
        rotate: 0
    - name: _plate_tab
      operation: add
      where: matrix_extra_number
      adjust:
        shift: [outline_margin+mcu_margin, 0]
        rotate: -90
    - name: _plate_tab
      operation: add
      where: matrix_middle_number
      adjust:
        shift: [-1.15U, outline_margin]
        rotate: 0
    - name: _plate_tab
      operation: add
      where: matrix_middle_number
      adjust:
        shift: [1.75U, outline_margin]
        rotate: 0
    - name: _plate_tab
      operation: add
      where: matrix_extra_number
      adjust:
        shift: [U, outline_margin]
        rotate: 0
    - what: outline
      name: _switches
      operation: subtract
    # jstph cutout
    - what: rectangle
      size: [12, 6]
      operation: stack
      where: matrix_extra_top
      adjust:
        shift: [jstph_x + 3, jstph_y - 0.5]

    # rotary encoder cutout
    - what: rectangle
      size: mx_cutout
      operation: subtract
      where: matrix_extra_home
      adjust:
        shift: [rotary_encoder_x, rotary_encoder_y]


pcbs:
  spleeb:
    outlines:
      main:
        outline: pcb_outline
    footprints:
      promicro:
        type: promicro-jumper-reverse
        nets:
          P21: extra_col
          P20: inner_col
          P19: index_col
          P18: middle_col
          P15: ring_col
          P14: pinky_col
          P16: outer_col
          P10: rot_right
          P1: led
          P0: serial
          P2: SDA
          P3: SCL
          P4: rot_left
          P5: number_row
          P6: top_row
          P7: home_row
          P8: bottom_row
          P9: mods_row
        params:
          orientation: down
          side: back
          reverse: true
          names: off
          mask: single
          marker: column
        anchor:
          - ref: matrix_extra_number
            shift: [((U/2) + mcu_margin) / 2, -8.75]
            rotate: -90
      rotary:
        type: rotary
        anchor:
          - ref: matrix_extra_home
            shift: [rotary_encoder_x, rotary_encoder_y]
            rotate: 90
        nets:
          from: extra_col
          to: extra_bottom
          A: rot_left
          B: rot_right
          C: GND
      rotary_diode:
        type: diode
        anchor:
          - ref: matrix_extra_home
            shift: [rotary_encoder_x - diode_x, rotary_encoder_y - diode_y]
            rotate: diode_rotate
        nets:
          from: extra_bottom
          to: bottom_row
        params:
          via_in_pad: true
      rst_tactile:
        type: button
        params:
          side: B
          variant: 4_pin_th_side
        anchor:
          - ref: matrix_index_number
            shift: [U-2, (U/2)]
            rotate: 0
        nets:
          from: GND
          to: RST
      trrs:
        type: trrs
        nets:
          A: GND
          B: GND
          C: serial
          D: VCC
        anchor:
          ref: matrix_extra_number
          shift: [trrs_x, trrs_y]
          rotate: 0
        params:
          reverse: true
          symmetric: true
      jstph:
        type: jstphx4
        params:
          side: both
        nets:
          P1: GND
          P2: VCC
          P3: SDA
          P4: SCL
        anchor:
          - ref: matrix_extra_top
            shift: [jstph_x, jstph_y]
      gnd_zone:
        type: rawkicad
        params:
          data: '(zone (net 5) (net_name "GND") (layer "B.Cu") (tstamp caa0d601-a82f-4f3d-b68a-b3d2e5eb9291) (hatch edge 0.508)
    (connect_pads (clearance 0.508))
    (min_thickness 0.254)
    (fill (thermal_gap 0.508) (thermal_bridge_width 0.508))
    (polygon
      (pts
        (xy 159 37)
        (xy -13.4 36.95)
        (xy -14.3 -85.65)
        (xy 157.5 -85.75)
      )
    )
  )'
